webpackJsonp([68481481023546],{7683:function(e,t){e.exports={data:{post:{html:'<p>We now have a new expat blogger in Hamburg... <a href="http://emilyatmills.blogspot.com/">Emily</a>, who <a href="http://emilyatmills.blogspot.com/2006/09/herzlich-willkommen.html">arrived in town this week</a>. Welcome to the most beautiful city in the world*. It takes a few months to become a real <a href="http://www.jbittner.com/germany/2006/07/second-whiney-expat-bloggers-in.html">whiney expat</a>, but welcome to the club!</p>\n<ul>\n<li>(when the sun shines, which is about 2 weeks a year. The 2 weeks for this year are already done. But we\'ve still got several dozen rainy days to go yet.)</li>\n</ul>',fields:{title:"New Hamburg Expat Blogger",date:"08 Sep 2006",url:"https://papascott.de/2006-09-08-new-hamburg-expat-blogger/"}}},pathContext:{slug:"/2006-09-08-new-hamburg-expat-blogger/",prev:{fields:{title:"PapaScott Sells Out",date:"07 Sep 2006",slug:"/2006-09-07-papascott-sells-out/"}},next:{fields:{title:"Aliens at Roswell",date:"09 Sep 2006",slug:"/2006-09-09-aliens-at-roswell/"}}}}}});
